const MainLayout = withRouter(props => {
  const {location} = props;
  return(
    <div>
        <Layout className="layout">
        <Header>
          <div className="logo">
            Hello
          </div>
          <Menu
            theme="dark"
            mode="horizontal"
            // defaultSelectedKeys={['2']}
